import React, { useEffect, useState } from 'react';
import Filter from '../../common/filter-section/filter-section.component';

import './home.component.scss'



export default function Home() {


    return (
        <div className='home-wrapper'>
            <Filter filterHeading='launch Year' options={launchYearFilter} activeFilterValue={activeLanuchYear} lauchYearChangeCallback={(year) => handleLauchYearChange(year)} />

            <Filter filterHeading='' activeFilterValue={isSuccessfulLaunch} options={successfulLaunchFilter} />

            <Filter filterHeading='' activeFilterValue={isSuccessfulLand} options={successfulLandFilter} />
        </div>
    )
}
